package com.wml.springboot.auth.entity;public class OperationAddress extends BaseEntity {	private static final long serialVersionUID = 748718941228442377L;	private Long addressId;	private Long resourceId;	private String operationKey;	private String operationAddressName;	private String operationAddressUrl;	private String parameterName1;	private String parameterValue1;	private String parameterName2;	private String parameterValue2;	private String parameterName3;	private String parameterValue3;	private String metadataId;	private String domain;	public String getDomain() {		return this.domain;	}	public void setDomain(String domain) {		this.domain = domain;	}	public boolean equals(Object obj) {		if ((obj instanceof OperationAddress)) {			OperationAddress operationAddress = (OperationAddress) obj;			if (operationAddress.getAddressId() == null) {				return operationAddress == this;			}			return operationAddress.getAddressId().equals(this.addressId);		}		return false;	}	public int hashCode() {		if (this.addressId == null) {			return 0;		}		return this.addressId.hashCode();	}	public String toString() {		return this.resourceId + " --> " + this.operationKey + " --> "				+ this.addressId;	}	public Long getAddressId() {		return this.addressId;	}	public void setAddressId(Long addressId) {		this.addressId = addressId;	}	public String getMetadataId() {		return this.metadataId;	}	public void setMetadataId(String metadataId) {		this.metadataId = metadataId;	}	public String getOperationAddressName() {		return this.operationAddressName;	}	public void setOperationAddressName(String operationAddressName) {		this.operationAddressName = operationAddressName;	}	public String getOperationAddressUrl() {		return this.operationAddressUrl;	}	public void setOperationAddressUrl(String operationAddressUrl) {		this.operationAddressUrl = operationAddressUrl;	}	public String getOperationKey() {		return this.operationKey;	}	public void setOperationKey(String operationKey) {		this.operationKey = operationKey;	}	public String getParameterName1() {		return this.parameterName1;	}	public void setParameterName1(String parameterName1) {		this.parameterName1 = parameterName1;	}	public String getParameterName2() {		return this.parameterName2;	}	public void setParameterName2(String parameterName2) {		this.parameterName2 = parameterName2;	}	public String getParameterName3() {		return this.parameterName3;	}	public void setParameterName3(String parameterName3) {		this.parameterName3 = parameterName3;	}	public String getParameterValue1() {		return this.parameterValue1;	}	public void setParameterValue1(String parameterValue1) {		this.parameterValue1 = parameterValue1;	}	public String getParameterValue2() {		return this.parameterValue2;	}	public void setParameterValue2(String parameterValue2) {		this.parameterValue2 = parameterValue2;	}	public String getParameterValue3() {		return this.parameterValue3;	}	public void setParameterValue3(String parameterValue3) {		this.parameterValue3 = parameterValue3;	}	public Long getResourceId() {		return this.resourceId;	}	public void setResourceId(Long resourceId) {		this.resourceId = resourceId;	}}